import React from "react";
import "../css/landing.css";
import hero from "../images/hero.jpg";

function Landing() {
  return (
    <div>
      <img src={hero} className="heroImg" />
      <div className="heroText">
        <h1 className="everythingText">
          Everything you need to<br></br>solve anything you want.
        </h1>
        <h1 className="withKeyText">
          With key AI Tools, magic calibrations, and more,
          <br></br>ChemE.AI is your next-generation<br></br>problem solving
          suite. Right inside your browser.
        </h1>
      </div>
    </div>
  );
}

export default Landing;
